import { CREATE_PROFILE, READ_PROFILE, UPDATE_PROFILE } from "./profileTypes";

export default (profile = [], action) => {
  switch (action.type) {
    case CREATE_PROFILE:
      return profile;
    case READ_PROFILE:
      return profile;
    case UPDATE_PROFILE:
      return profile;
    default:
      return profile;
  }
};
